INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 2, 1.47, "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 10001, 1, -470.0, 2002, "2023/06/30 12:00:00", "クローチェ", 1, 126401, 1, "2023/09/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 2.15, "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", 10002, 2, -470.0, 2002, "2023/06/30 12:00:00", "クローチェ", 2, 126401, 1, "2023/09/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 2, 0.0, "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 10003, 2, -470.0, 2002, "2023/06/30 12:00:00", "ライラエル", 1, 126501, 1, "2023/09/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 0.0, "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 10004, 1, -470.0, 2002, "2023/06/30 12:00:00", "ライラエル", 2, 126501, 1, "2023/09/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 2, 0.0, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 10005, 2, -470.0, 2002, "2023/09/15 15:00:00", "リンド", 1, 127702, 2, "2023/12/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 2, 0.0, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 10006, 2, -470.0, 2002, "2023/09/15 15:00:00", "リンド", 2, 127702, 2, "2023/12/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 0.0, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 10007, 1, -470.0, 2002, "2023/09/15 15:00:00", "ヴルム", 1, 127802, 2, "2023/12/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 6.5, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 10008, 2, -470.0, 2002, "2023/09/15 15:00:00", "ヴルム", 2, 127802, 2, "2023/12/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 0.0, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 10009, 2, -470.0, 2002, "2023/12/15 15:00:00", "アネモネ", 1, 129602, 3, "2024/03/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 0.0, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 10010, 2, -470.0, 2002, "2023/12/15 15:00:00", "アネモネ", 2, 129602, 3, "2024/03/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 0.0, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 10011, 1, -470.0, 2002, "2023/12/15 15:00:00", "ネフィ=ネラ", 1, 129701, 3, "2024/03/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 6.2, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 10012, 2, -470.0, 2002, "2023/12/15 15:00:00", "ネフィ=ネラ", 2, 129701, 3, "2024/03/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 5, 3.1, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 10013, 3, -470.0, 2002, "2024/03/15 15:00:00", "カノン", 1, 130301, 4, "2024/06/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 2, 6.15, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 10014, 3, -470.0, 2002, "2024/03/15 15:00:00", "カノン", 2, 130301, 4, "2024/06/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 2, 0.0, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 10015, 2, -470.0, 2002, "2024/03/15 15:00:00", "ナーナ", 1, 130401, 4, "2024/06/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 3.35, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 10016, 2, -470.0, 2002, "2024/03/15 15:00:00", "ナーナ", 2, 130401, 4, "2024/06/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 0.0, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 10017, 1, -470.0, 2002, "2024/06/15 15:00:00", "ホウオウ", 1, 130502, 5, "2024/09/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 3.18, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 10018, 2, -470.0, 2002, "2024/06/15 15:00:00", "ホウオウ", 2, 130502, 5, "2024/09/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 4, 0.0, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 10019, 4, -470.0, 2002, "2024/06/15 15:00:00", "ホウオウ", 3, 130503, 5, "2024/09/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 2, 4.9, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 10020, 1, -470.0, 2002, "2024/06/15 15:00:00", "ネア", 1, 123301, 5, "2024/09/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 2, 4.8, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 10021, 1, -470.0, 2002, "2024/06/15 15:00:00", "ネア", 2, 123301, 5, "2024/09/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 4.922, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 10022, 3, -470.0, 2002, "2024/09/15 15:00:00", "カリザ", 1, 133301, 6, "2024/12/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 5, 9.638, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 10023, 3, -470.0, 2002, "2024/09/15 15:00:00", "カリザ", 2, 133301, 6, "2024/12/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 2, 2.88, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 10024, 1, -470.0, 2002, "2024/09/15 15:00:00", "ミーア", 1, 133401, 6, "2024/12/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 4.818, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 10025, 5, -470.0, 2002, "2024/09/15 15:00:00", "ミーア", 2, 133401, 6, "2024/12/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 1.78, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 10026, 2, -470.0, 2002, "2024/12/15 15:00:00", "グレイス", 1, 133002, 7, "2025/03/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 7, 6.15, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 10027, 1, -470.0, 2002, "2024/12/15 15:00:00", "グレイス", 2, 133002, 7, "2025/03/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 2, 4.28, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 10028, 6, -470.0, 2002, "2024/12/15 15:00:00", "ヴァイオレット", 1, 133102, 7, "2025/03/22 14:59:59");
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (0.0, 1, 0.0, "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 10029, 1, -470.0, 2002, "2024/12/15 15:00:00", "ヴァイオレット", 2, 133102, 7, "2025/03/22 14:59:59");
